import React from 'react';
import '../style/Header.css'

function Team(props) {
    return(
        <div class="block">
            <br />
            <h3>Team: {props.name}</h3>
            <p>Score: {props.score}</p>
            <br />
            <button class="block">Hello, World!</button>
        </div>
    );
}

export default Team;
